import React, { Component } from "react";
import {
  Link,
} from "react-router-dom";

class Navigation extends Component {
  constructor(props) {
    super(props)

    this.state = {
      navigation: [
        {
          cta: 'Welcome',
          url: '/'
        },
        {
          cta: 'Our Story',
          url: '/ourstory'
        },
        {
          cta: 'RSVP',
          url: 'rsvp'
        },
        {
          cta: 'Moments',
          url: '/moments'
        },
        {
          cta: 'Registry',
          url: '/registry'
        },
      ]
    }
  }



  render() {
    return (
      <nav className="navbar navbar-expand-sm">
        <ul className="navbar-nav">
          <li className="nav-item">
           <Link className="nav-link" exact to="/">Welcome</Link>
          </li>
          <li className="nav-item">
            <Link className="nav-link" to="/ourstory">Our Story</Link>
          </li>
          <li className="nav-item">
            <Link className="nav-link" to="/rsvp">RSVP</Link>
          </li>
          <li className="nav-item">
            <Link className="nav-link" to="/moments">Moments</Link>
          </li>
          <li className="nav-item">
            <Link className="nav-link" to="/registry">Registry</Link>
          </li>
        </ul>
      </nav>
    );
  }
}

export default Navigation;
